import React, { useState } from 'react';

const Header = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <header style={styles.header}>
      <h1 style={styles.title}>My React App</h1>
      <nav style={styles.nav}>
        <ul style={styles.navList}>
          <li style={styles.navItem}><a href="/" style={styles.navLink}>Services</a></li>
          <li style={styles.navItem} onMouseEnter={toggleDropdown} onMouseLeave={toggleDropdown}>
            <a href="/about" style={styles.navLink}>Solutions </a>
            {isDropdownOpen && (
              <ul style={styles.dropdownMenu}>
                <li style={styles.dropdownItem}><a href="/about/team" style={styles.navLink}>Team</a></li>
                <li style={styles.dropdownItem}><a href="/about/mission" style={styles.navLink}>Mission</a></li>
                <li style={styles.dropdownItem}><a href="/about/history" style={styles.navLink}>History</a></li>
              </ul>
            )}
          </li>
          <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Resources</a></li>
          <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Pricing</a></li>
          li
        </ul>
      </nav>
    </header>
  );
};

const styles = {
  header: {
    backgroundColor: '#043873',
    padding: '1rem',
    color: 'white',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  title: {
    margin: '0',
  },
  nav: {
    display: 'flex',
  },
  navList: {
    listStyle: 'none',
    margin: '0',
    padding: '0',
    display: 'flex',
  },
  navItem: {
    marginLeft: '1rem',
    position: 'relative',
  },
  navLink: {
    color: 'white',
    textDecoration: 'none',
  },
  dropdownMenu: {
    position: 'absolute',
    top: '100%',
    left: '0',
    backgroundColor: '#043873',
    listStyle: 'none',
    margin: '0',
    padding: '0.5rem 0',
    borderRadius: '4px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
  },
  dropdownItem: {
    padding: '0.5rem 1rem',
  },
};

export default Header;
